import React from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button
} from 'reactstrap';

const Example = (props) => {
  return (
    <div>
            <card>
        <cardimg top width="100%" src="/assets/318x180.svg" alt="Card image cap">
          <cardbody>
            <cardtitle tag="h5">Nome da Vaga</cardtitle>
            <cardsubtitle tag="h6" classname="mb-2 text-muted">Categoria da Vaga</cardsubtitle>
            <cardtext>Descricao da Vaga</cardtext>
            <CardBody></CardBody>

            <button>Button</button>
          </cardbody>
        </cardimg></card>
    </div>
  );
};

export default Example;
